import React from 'react';
import PropTypes from 'prop-types';


const Recipe = (props) => {
  const {RecipeCallback} = props;
  return(
    <div>
      <div>
      console.log(props);
        {props.label}
      </div>
    </div>
  )
}

Recipe.propTypes = {
  label: PropTypes.string
};


export default Recipe;
